import React from 'react';


const GoalList = ({ goals }) => {
  return (
    <div>
      <h2>Goals</h2>
      {goals.map((goal) => (
        <div key={goal.id}>
          <h3>{goal.category}</h3>
          <p>{goal.description}</p>
          <p>Deadline: {goal.deadline}</p>
        </div>
      ))}
    </div>
  );
};

const mapStateToProps = (state) => ({
  goals: state.goals,
});

export default GoalList;
